**Describe the bug**
got exception after  main() return.

**Urgency**

**System information**
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Windows10
- ONNX Runtime installed from (source or binary): binary
- ONNX Runtime version: 1.1.2
- Python version: not used
- Visual Studio version (if applicable): VS2019(cmake project)
- GCC/Compiler version (if compiling from source):
- CUDA/cuDNN version: CUDA10.0, cuDNN7.6.5.32
- GPU model and memory: MX150 2GMem

**To Reproduce**
compile and run in X64_Debug mode.

**Expected behavior**
normally return .no exception.

**Screenshots**
![ 2020-03-04 122521](https://user-images.githubusercontent.com/1401364/75845169-46985780-5e13-11ea-8399-c82f5c5e858b.png)


**Additional context**
```c++


#include <iostream>
#include "onnxruntime_cxx_api.h"
#ifdef GPU_CUDA
#include "cuda_provider_factory.h"
#endif

void test()
{
    static Ort::Env env_(ORT_LOGGING_LEVEL_ERROR, "ocrgt");
    Ort::SessionOptions session_options;
    session_options.SetGraphOptimizationLevel(GraphOptimizationLevel::ORT_ENABLE_ALL);
    session_options.SetExecutionMode(ExecutionMode::ORT_SEQUENTIAL); //ORT_PARALLEL  ORT_SEQUENTIAL
    auto status = OrtSessionOptionsAppendExecutionProvider_CUDA(session_options, 0);
 
    std::wstring wpath = L"c:\\work\\ocr-gt\\resnet50v2.onnx";
    Ort::Session session(env_, wpath.c_str(), session_options);
    size_t in_count = session.GetInputCount();
    size_t out_count = session.GetOutputCount();
    std::cout << "ok tolaoad model"<< in_count<<","<<out_count<<std::endl;
}
int main(int argc, char* argv[]) {
    std::cout << "Hello "<<argv[0]<<std::endl;
    test();
    std::cout << "ok:" << std::endl;
    return 0;
}

```

**System information**
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Windows 10
- ONNX Runtime installed from (source or binary): binary (install by VS Nuget Package)
- ONNX Runtime version: 1.1.0
- Visual Studio version (if applicable): VS 2015
- CUDA/cuDNN version: 10.0 / 7.3
- GPU model and memory: RTX 2080

---------------------------------------------------------------------------------------------

How can I get the value of the multiple layer as output?

I want to use a network with multiple outputs from one input.
(For example, input the face image, and receive the face posture (yaw, pitch, roll) as output.)

We are using class as the code below. How can we use multiple output if we modify it?

```
onnx_module::onnx_module(std::string sModelPath, int nInputC, int nInputWidth, int nInputHeight, int nOutputC, int nOutputWidth, int nOutputHeight)
{
	std::string sPath = sModelPath;
	wchar_t* wPath = new wchar_t[sPath.length() + 1];
	std::copy(sPath.begin(), sPath.end(), wPath);
	wPath[sPath.length()] = 0;


	Ort::SessionOptions session_options;
	Ort::ThrowOnError(OrtSessionOptionsAppendExecutionProvider_CUDA(session_options, 0));
	session_options.SetGraphOptimizationLevel(GraphOptimizationLevel::ORT_ENABLE_EXTENDED);
	session_ = new Ort::Session(env, wPath, session_options);
	//session_ = new Ort::Session(env, wPath, Ort::SessionOptions{ nullptr });
	delete[] wPath;

	const int batch_ = 1;

	const int channel_in = nInputC;
	const int width_in = nInputWidth;
	const int height_in = nInputHeight;

	const int channel_out = nOutputC;
	const int width_out = nOutputWidth;
	const int height_out = nOutputHeight;

	input_image_.assign(width_in * height_in * channel_in, 0.0);
	results_.assign(nOutputWidth * nOutputHeight * nOutputC, 0.0);

	input_shape_.clear();
	input_shape_.push_back(batch_);
	input_shape_.push_back(channel_in);
	input_shape_.push_back(width_in);
	input_shape_.push_back(height_in);

	output_shape_.clear();
	output_shape_.push_back(batch_);
	output_shape_.push_back(channel_out);
	output_shape_.push_back(width_out);
	output_shape_.push_back(height_out);



	auto memory_info = Ort::MemoryInfo::CreateCpu(OrtDeviceAllocator, OrtMemTypeCPU);
	input_tensor_ = Ort::Value::CreateTensor<float>(memory_info, input_image_.data(), input_image_.size(), input_shape_.data(), input_shape_.size());
	output_tensor_ = Ort::Value::CreateTensor<float>(memory_info, results_.data(), results_.size(), output_shape_.data(), output_shape_.size());
}

void onnx_module::Run(std::vector<float>& vResults)
{
	const char* input_names[] = { "input" };
	const char* output_names[] = { "output" };

	(*session_).Run(Ort::RunOptions{ nullptr }, input_names, &input_tensor_, 1, output_names, &output_tensor_, 1);

	vResults.assign(results_.begin(), results_.end());
}
```
